    true,nt"url": null,nt"notes": "At the Department of Veterans Affairs (VA),
    our most important mission is to provide the high quality health care and benefits
    Veterans have earned and deserve u2014 when and where they need it. To support that
    mission, we measure and release patient access data.rnrnRegularly updated patient
    access data is available for all VA Medical Centers and Community-Based Outpatient
    Clinics including average wait times, number of patients waiting for a scheduled
    appointment and number of patients that cannot be scheduled for an appointment in
    90 days or less. Both completed and pending appointment data is available.rnrnPending:
